import React from 'react';
import '../App.css';


function Aboutt() {
return (
    <div className='header'>
        <div className="banner">
            <p>Made by Himanshu Kumar</p>
            <p>We all need someone to share our thoughts with without the fear of being judged, maintaining mental health is just as important as physical health and hence i made this project to increase mental health awareness</p>
            <p>&#169; May 2023</p>
        </div>
    </div>
  );
}

export default Aboutt;
